import React, { Component, createContext, useState } from 'react';
import '../App.css';
import Head from './head';
import Classcity from './city';
import Classversion from './version';




function Carmodel(props) {
  
      const initialstate = {Selectedcity: 'Bangalore',
      Selectedversion: 'Lxi ₹ 6.10 Lakh',
      versionpopupvisible: false,
      carpopupvisible: false,
    };

   const [car, setcar] = useState(initialstate);

   setcar((prevState) => {
       console.log(...prevState);
       return({...prevState, carpopupvisible: true})
   })

    useEffect(() => {
       
        return () => {
            console.log("useeffect");
        }
    }, [car.Selectedcity])


   
        return (

          <div>
              <Head />
              <div className={"py-5 bg-light"}>
            <div className="container">
              <h3 className="h3">Maruti Suzuki Swift</h3>
    
    
              <div className="row">
                <div className=" card mb-4 shadow-sm">
                  <img src={'images/maruti1.jpg'} alt="Img" className="img-thumbnail img3" />
                </div>
            {
                
            }
             <Classversion />
             <Classcity />
    
                <div className="card mb-4 shadow-sm ">
                  <div className="card-body">
                    <h3 className="card-title"> ₹ 5.96 Lakh</h3>
                    <div className="row">
                      <p className="card-text">On-Road Price</p>
                      <p className="card-text">EMI ₹ 9,740 For 5 Years</p>
                    </div>
    
    
    
                    <div className="d-flex justify-content-between align-items-center">
                      <div className="btn-group">
    
                        <a className="btn btn-sm btn-outline-secondary" style={{ color: "blue" }}>View Price Breakup</a>
                      </div>
    
    
                    </div>
                  </div>
                </div>
              </div>
    
            </div>
        
          </div>
    

          </div>
              
    
        );
      
    
    
  
}
  
   
  
    



export default Carmodel;
